Hindi Title - Mujhe is Dost Se Bachao

High-strung father-to-be Peter Highman is forced to hitch a ride with aspiring actor Ethan Tremblay on a road trip in order to make it to his child's birth on time.
Storyline

Peter Highman (Robert Downey Jr.) must get to LA in five days to be at the birth of his firstborn. He is about to fly home from Atlanta when his luggage and wallet are sent to LA without him, and he is put on the &quot;no-fly&quot; list. Desperate to get home Peter is forced to accept the offer of Ethan Tremblay (Zach Galifianakis) to hitch a ride with him cross-country. Peter is about to go on the most terrifying and agonizing journey of his life.

Motion Picture Rating


Rated R for language, drug use and sexual content.

